import React, {Component} from 'react';
import axios from 'axios';


var kk = {
    margin : "-10px"
        }
var lk = {
    height : "100%"
}

export default class Home extends React.Component {
    constructor(props){
        super(props);
        this.state={
            data:null,
        };  
    }

    getuserdata= () => {
        var self =this;
        var username="hhkk";
        var password="1425";
        axios.post('http://127.0.0.1:8000/login/',{headers: {'Content-Type': 'application/json'}},{data:{username,password}})
            .then(res=>{
                console.log(res);
            })
            .catch(error=>{
                console.log(error)
            });
        axios.get('http://127.0.0.1:8000/data/user/')
            .then((response)=> { 
                console.log(response._user);
            })
            .catch(function(error){
                console.log(error);
            });
    }

    render() {
        return  (<div style={lk}><center> <img src="/static/index.png" width="30" height="30" style={kk}/> &nbsp;&nbsp;&nbsp; Instagram &nbsp; &nbsp; &nbsp;&nbsp;
        <input type="text" placeholder="search"/> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <a><img src="/static/images.png" onClick={this.getuserdata} width="30" height="30" style={kk}/></a> &nbsp; &nbsp; &nbsp; &nbsp;</center>
        </div>
        );
    } 
}
